import { Search } from '@mui/icons-material'
import React from 'react'
import './Widgets.css'
import {
    TwitterTimelineEmbed,
    TwitterShareButton,
    // TwitterFollowButton,
    // TwitterHashtaguButton,
    // TwitterMentionButton,
    TwitterTweetEmbed,
    // TwitterMomentShare,
    // TwitterDMButton,
    // TwitterVideoEmbed,
    // TwitterOnAirButton,
} from "react-twitter-embed";

function Widgets() {
  return (
    <div className="widgets">
        <div className="widgets-input">
            <div className="widget-searchIcon">
        <i class="fa-solid fa-magnifying-glass"></i>
        </div>
        <input placeholder="キーワード検索" type="text"/>


        </div>
        <div className="widgets-widgetContainer">
            <h2>今どうしてる？</h2>
            <TwitterTweetEmbed tweetId={"1704197979299631477"}/>
            <TwitterTimelineEmbed sourceType="profile" screenName="JetPhotos" options={{height:400}} />
            <TwitterShareButton url={"https://twitter.com/nakayan_uniql"}
            options={{text:"React勉強中", via:"nakayan_uniql"}} />



        </div>
    </div>
  )
}

export default Widgets
